import '../Pages/All.css'
function Form({stData ,handler}){
  
    return(
        <div className='correction'>
            <input placeholder="name" value={stData[0].name} onChange={handler} />
            <input placeholder="age"  value={stData[0].age} onChange={handler} />
            <input placeholder="profile"  value={stData[0].profile} onChange={handler} />
            <button>Submit-Form</button>
            
        </div>
    )
}
export default Form
